    "type": "opportunities",
    "link": "http:\/\/belong-marketplace.herokuapp.com\/opportunities\/family-coach\/",
    "title": {"rendered": "Family Coach"},
    "content": {"rendered": "<p>You can play a vital role in Safe Families for Children (Safe Families) by volunteering as a Family Coach to help parents get back on their feet. As a Family Coach, you will<\/p>\n<ul>\n<li><strong>support<\/strong> the Host Family. This ensures that families get the support and resources they need to provide a safe and nurturing environment for children.<\/li>\n<li><strong>monitor<\/strong> children\u2019s safety. Because safety is a top priority, the Family Coach begins assessing safety within 48 hours of a child moving in with the Host Family\u2014and each week for at least a month.<\/li>\n<li><strong>provide<\/strong> a family in need with resources, such as community referrals and assistance in making their appointments.<\/li>\n<li><strong>facilitate<\/strong> the relationship between the Host Family and the Placing Family with compassion and empathy.<\/li>\n<\/ul>\n<p>You will also<\/p>\n<ul>\n<li><strong>listen<\/strong> to Host Families and Placing Families. The Family Coach provides space for them to express their thoughts and concerns.<\/li>\n<li><strong>manage<\/strong> expectations. For example, the Host Family may feel that they must fix problems or situations that are not their responsibility. Alternately, if a hosting arrangement seems longer than expected, the Family Coach is needed to temper expectations.<\/li>\n<li><strong>show<\/strong> empathy, hope, grace, and compassion. We work hard to err on the side of grace.<\/li>\n<li><strong>problem solve<\/strong>. Family Coaches work with the church and other community resources to assist Placing Families.<\/li>\n<li><strong>reassure<\/strong>. Stressful situations require a calm presence and the ability to give hope to those who may feel hopeless.<\/li>\n<\/ul>\n"},
