    "slug": "host-family",
    "type": "opportunities",
    "link": "http:\/\/belong-marketplace.herokuapp.com\/opportunities\/host-family\/",
    "title": {"rendered": "Host Family"},
    "content": {"rendered": "<p>If you are looking for a truly rewarding experience, consider becoming a Safe Families for Children (Safe Families) Host Family. You will make a lasting impression on a child in need and possibly change the trajectory of a family.<\/p>\n<p>You must be at least 25 years old, emotionally and financially stable, mature, law abiding, healthy, and active. You also must be willing to engage in a long-term friendship with a family in need, agree to not use drugs, and refrain from using profanity or engaging in other negative behavior that may impact a child.<\/p>\n"},
