    "title": {"rendered": "House Party Host"},
    "content": {"rendered": "<p>House Parties are a great way for you to bring together your friends and colleagues to get the word out about Refuge for Women. It\u2019s super easy. All you have to do is set a date and time, and one of our Refuge for Women staff will come, present information and materials about the organization, and help your friends learn about how they can get involved.<\/p>\n"},
