    "type": "opportunities",
    "link": "http:\/\/belong-marketplace.herokuapp.com\/opportunities\/day-shift-worker\/",
    "title": {"rendered": "Day Shift Worker"},
    "content": {"rendered": "<p>Day shift workers volunteer in the home Monday &#8211; Friday between the hours of 8:00 am &#8211; 4:30 pm. Day shift volunteers assist the Program Director with tasks such as administration,\u00a0cleaning, providing transportation, running errands, teaching classes and support with regular daily programming.<\/p>\n<p><strong>Requirements \u2013\u00a0<\/strong>Must be a committed Christ-follower. Must commit to one weekend shift per month for a minimum of six months. All shift workers are asked to conduct a background check and go through an interview process with the Program Director. Ongoing training will be provided. All shift workers are required to sign a confidentiality agreement.<\/p>\n"},
