    "link": "http:\/\/belong-marketplace.herokuapp.com\/opportunities\/weekend-shift-worker\/",
    "title": {"rendered": "Weekend Shift Worker"},
    "content": {"rendered": "<p id=\"yui_3_17_2_1_1474043179301_267\">Weekend shift workers are vital to the success of the organization. Weekend shifts are Friday 4:00 pm to Saturday 4:00 pm and Saturday 4:00 pm until Sunday 4:00 pm. Our weekend workers do life with our residents, take them to various weekend activities, drive the residents to church, and ensure that safety and house guidelines are followed closely. Weekend workers have access to a private room, bathroom, and office area. They report on the weekend activities and follow appropriate policies and procedures.<\/p>\n<p><strong>Requirements \u2013\u00a0<\/strong>Must be a committed Christ-follower. Must commit to one weekend shift per month for a minimum of six months. All shift workers are asked to conduct a background check and go through an interview process with the Program Director. Ongoing training will be provided. All shift workers are required to sign a confidentiality agreement.<\/p>\n"},
