    "link": "http:\/\/belong-marketplace.herokuapp.com\/opportunities\/weekday-night-shift-worker\/",
    "title": {"rendered": "Weekday Night Shift Worker"},
    "content": {"rendered": "<p id=\"yui_3_17_2_1_1474043179301_246\">Our night shift workers are an integral part of our volunteer team. They have the opportunity to do life with and directly impact the women in the home. Our night shifts start at 4:00pm and ends the following morning at 8:30am on Sunday &#8211; Thursday nights. We ask these volunteers to stay overnight in the home to care for our residents, ensure their safety, and oversee the evening program. Night shift workers have access to a private room, bathroom, and office area. They report on the evenings activities and follow appropriate policies and procedures.<\/p>\n<p><strong>Requirements \u2013\u00a0<\/strong>Must be a committed Christ-follower. Must commit to one night shift per week for a minimum of six months. All shift workers are asked to conduct a background check and go through an interview process with the Program Director. Ongoing training will be provided. All shift workers are required to sign a confidentiality agreement.<\/p>\n"},
