    "link": "http:\/\/belong-marketplace.herokuapp.com\/opportunities\/medical-case-management-volunteers\/",
    "title": {"rendered": "Medical Case Management Volunteers"},
    "content": {"rendered": "<p>These volunteers would assist the Medical Case Manager with \u00a0refugees overcoming medical issues and rebuilding their health.\u00a0 The volunteer would meet once a week with family members, assess their medical conditions, ensure that they are taking their medication correctly, explain any medical documents they have been given, and inform the case manager if they have received any referrals.\u00a0It would be helpful if the volunteer could assist with transportation to medical appointments, if possible. Volunteers with a medical background (professional or personal) are preferred.<\/p>\n"},
