    "title": {"rendered": "Practice English with Refugees"},
    "content": {"rendered": "<p>Refugees in RefugeeOne\u2019s English program have the opportunity to stay an extra hour after class for additional tutoring and conversation practice with a volunteer. Classes are hosted Monday through Thursday at the RefugeeOne office, with after-class tutoring in the late morning and mid-afternoon. This experience is integral in helping refugees develop the language skills necessary to successfully transition into their new life in the United States. Volunteers should be fluent in English, culturally sensitive, and able to commit to one or two regular tutor shifts a week. Free tutor training is available for those interested.<\/p>\n"},
