    "slug": "tutor-a-refugee-child",
    "type": "opportunities",
    "link": "http:\/\/belong-marketplace.herokuapp.com\/opportunities\/tutor-a-refugee-child\/",
    "title": {"rendered": "Tutor a Refugee Child"},
    "content": {"rendered": "<p>RefugeeOne\u2019s in-home tutors work one-on-one with a child who has recently arrived in the United States. In a mutually beneficial exchange of culture and knowledge, tutors will help youth ages 6 &#8211; 17 practice English and adjust to the U.S. school system. We are looking for people with caring hearts, cultural sensitivity, patience, dedication, and English fluency. In-home tutoring positions are available in Chicago, Evanston, and Skokie. We expect tutors to meet with their student once a week and maintain contact with RefugeeOne through monthly progress reports. In-home tutoring schedules are flexible and sessions may occur on evenings and weekends.<\/p>\n"},
