    "link": "http:\/\/belong-marketplace.herokuapp.com\/opportunities\/mentor-a-refugee\/",
    "title": {"rendered": "Mentor a Refugee"},
    "content": {"rendered": "<p>Volunteer mentors help newly arrived refugees become self-sufficient and acclimate to a new culture. Mentors help by making a home visit once a week and practicing English, playing games, showing refugees how to ride public transit, and being supportive as a teacher, advocate and friend. This volunteer experience is a remarkable exchange, for you both have many things to teach one another. We expect mentors to see their partners once a week, maintain contact with RefugeeOne through monthly reports, and participate in occasional trainings. In-home mentoring schedules are flexible and sessions may occur on evenings and weekends.<\/p>\n"},
