    "link": "http:\/\/belong-marketplace.herokuapp.com\/opportunities\/family-retreat-volunteer\/",
    "title": {"rendered": "Family Retreat Volunteer"},
    "content": {"rendered": "<p>At both U.S. and International Family Retreat Centers,\u00a0special-needs families receive encouragement and care in the comfort of a safe and accessible family camp environment. They enjoy fun and fully-accessible, age-appropriate activities, along with meaningful conversations with families who understand the challenges of life with disability. The success of a Family Retreat depends not only on the leadership and programming, but on the distinctly Christian community which is carefully nurtured in order for families to feel blessed and supported. For this reason, Joni and Friends reserves the right to accept families and\/or assign accommodations based on our ability to meet the needs of all families in a safe and accepting Christian environment. Thank you for your understanding in helping us preserve the community of Family Retreat, and for helping to make retreat a positive and encouraging experience for everyone involved.<\/p>\n"},
