    "link": "http:\/\/belong-marketplace.herokuapp.com\/opportunities\/run-for-refugees\/",
    "title": {"rendered": "Run for Refugees"},
    "content": {"rendered": "<p>Location: Kildeer School, 3100 Old McHenry Road, Long Grove, IL Follow event signs from intersection of Rts. 83 and 53<\/p>\n<p>(This event is part of the Heritage Run\/Walk organized by the Rotary Club of Long Grove.)<\/p>\n<p>Registration fee $35 (waived for children under 12 and refugees)<\/p>\n<p>Get your friends to support you! Create your personal fundraising page when you register. Raise $500 or more and receive a handcrafted gift by a refugee artisan.<\/p>\n<p>Pancake breakfast and goody bag provided to all registered participants at the event. The event will be held rain or shine and is open to all ages. Participants aged 18 and under must have registration form signed by a parent or legal guardian.<\/p>\n<p>Can\u2019t join us? You can still make a difference. Register for the event as a virtual walker.<\/p>\n"},
