    "title": {"rendered": "New Neighbor for Refugees"},
    "content": {"rendered": "<p>Provide hope and encouragement to refugees by joining the New Neighbor program:<\/p>\n<ul>\n<li>visit a refugee family once a week for three months to answer basic questions about life in the United States<\/li>\n<li>practice English with the family and introduce them to their community<\/li>\n<li>help ease a refugee family&#8217;s loneliness<\/li>\n<\/ul>\n"},
